import React, { Component } from "react";
import {  SideNavItem } from "react-materialize";

class SideNavItems extends Component {
    render() {
        return (
            <div >
                <SideNavItem
                        user={{
                            background: "img/jeremy-bishop-BuQ-jgeexaQ-unsplash.jpg",
                            email: "jdandturk@gmail.com",
                            name: "John Doe"
                        }}
                        userView
                    />
                    <SideNavItem  href='#!icon' icon='assignment_turned_in'>
                        Projects
                    </SideNavItem>
                    <SideNavItem href='#!second' icon='business'>Business</SideNavItem>
                    <SideNavItem divider />
                    {/* <SideNavItem subheader>My Account</SideNavItem> */}
                    <SideNavItem href='#!third' waves icon='person_pin'>
                        Profile
                    </SideNavItem>
                    <SideNavItem href='#!third' waves icon='power_settings_new'>
                        Logout
                    </SideNavItem>

                    <SideNavItem href='#!third' waves icon='trending_flat'>
                        Login
                    </SideNavItem>
            </div>
        )
    }
}

export default SideNavItems
